CREATE TABLE `customerinfo` (
  `id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `cid` mediumint(8) NOT NULL COMMENT '客户ID',
  `bankcard` varchar(30) DEFAULT NULL COMMENT '客户银行卡号',
  `bankname` varchar(50) DEFAULT NULL COMMENT '开户行',
  `bankadder` varchar(200) DEFAULT NULL COMMENT '开户行所在地',
  `bankusername` varchar(50) DEFAULT NULL COMMENT '银行户名',
  `useimg_path` varchar(250) DEFAULT NULL COMMENT '用户头像',
  `cardimg_path` varchar(250) DEFAULT NULL COMMENT '身份证头像正面',
  `cardimgt_path` varchar(250) DEFAULT NULL COMMENT '身份证反面',
  `store` tinyint(3) DEFAULT NULL COMMENT '仓位',
  `regiona` char(5) DEFAULT NULL COMMENT '冷库区域',
  `storename` tinyint(1) DEFAULT NULL COMMENT '冷库名称',
  `relativesname` varchar(35) DEFAULT NULL COMMENT '亲属姓名',
  `relativessex` tinyint(1) DEFAULT '0' COMMENT '0是女1是男',
  `relationship` varchar(20) DEFAULT NULL COMMENT '关系',
  `relationtem` varchar(20) DEFAULT NULL COMMENT '亲属手机',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=141 DEFAULT CHARSET=utf8;
